INSERT INTO `wp_posts` VALUES (8,1,'2023-08-24 00:09:55','2023-08-24 00:09:55','<ol><li>Quam non unde quidem</li><li>Id sequi amet et dolor</li><li>Odit soluta repudiandae eveniet maxime provident</li></ol>\n<h4>Excepturi laborum eveniet deserunt quia sunt repudiandae. Enim quo minima quibusdam officia</h4>\n<blockquote>Et libero id voluptates facere consectetur. Ullam nihil ullam explicabo eos. Dolor et pariatur id. Quasi cum commodi natus et illum quis consequatur. Atque ab non sed cum dolores ipsam placeat. Odio consequatur corrupti repudiandae alias. Corporis velit velit unde assumenda. Culpa quod reprehenderit vero hic. Voluptatibus velit voluptas nemo nisi maiores sed. Natus temporibus accusamus non labore. Quae accusantium adipisci a eius corporis nemo qui labore. Enim quidem rerum ut dolorem et quo non. Quia et molestiae velit autem ut aliquam. Veritatis quae natus dolores iure eveniet velit.</blockquote>\n<!--more-->\n<h1>Aut voluptatem hic tenetur dolores accusamus. Velit dolor asperiores doloremque fugit et dolorem. Molestiae tempora sed quia quas voluptate rerum</h1>\n<img class=\"alignleft\" alt=\"Quia sed et excepturi perspiciatis mollitia unde odit\" src=\"http://test-wordpress-next.local/wp-content/uploads/2023/08/41fe343a-73af-3da7-8c9e-a933e16a01cc.jpg\">\n<ol><li>Earum ut quis blanditiis minus</li><li>Corrupti et</li><li>Iure tempora impedit earum ea dolorem veritatis</li><li>Odio debitis recusandae quis illo nobis dolorem</li></ol>\n<p><a title=\"Commodi veniam est consequatur unde ipsam corporis.\" href=\"http://kshlerin.com/\">Maxime perspiciatis non aspernatur qui atque. At et</a> ipsum aut vel. Voluptas molestiae mollitia perferendis. Maiores magni sapiente sit eaque <a title=\"Debitis possimus praesentium et magni laboriosam praesentium.\" href=\"http://www.goodwin.net/\">ut</a> odio. Non nobis neque sunt quia voluptatum Ipsam quod illo <a title=\"Dolorem itaque.\" href=\"http://dickens.com/dolorem-perferendis-fugiat-facere-facere-aliquam-at\">perspiciatis. Assumenda ea distinctio</a> molestiae consectetur. Unde omnis nulla non esse</p>\n<img class=\"alignright\" src=\"http://test-wordpress-next.local/wp-content/uploads/2023/08/43787837-2118-3486-8ab0-fbc73fd93758.jpg\">\n<ol><li>Eaque doloribus iusto</li><li>Tempore deleniti modi sit voluptatem</li></ol>\n<ul><li>Vitae aut omnis quod est non est ullam tempora</li><li>Ad non occaecati</li><li>Atque libero et eum neque</li><li>Magnam voluptatem vero molestias</li><li>Quis ex aut soluta</li><li>Neque dolor laborum ipsum</li></ul>','Quo suscipit maiores repellat non','','trash','open','open','','quo-suscipit-maiores-repellat-non__trashed','','','2023-09-04 11:01:33','2023-09-04 11:01:33','',0,'http://test-wordpress-next.local/quo-suscipit-maiores-repellat-non/',0,'post','',0);
