INSERT INTO `wp_posts` VALUES (33,1,'2023-09-04 11:06:31','2023-09-04 11:06:31','<!-- wp:image {\"id\":34,\"width\":420,\"height\":366,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://test-wordpress-next.local/wp-content/uploads/2023/09/logo.webp\" alt=\"\" class=\"wp-image-34\" style=\"width:420px;height:366px\" width=\"420\" height=\"366\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>Constructeurs d’engins, équipementiers, mainteneurs, fournisseurs et sous-traitants de la filière ferroviaire... Tous seront au rendez-vous de Mecateameetings 2023 pour présenter leurs nouveautés et leurs savoir-faire. Le plus ? Mecateameetings est le seul événement français permettant l’exposition et la démonstration concrète des engins et outillages. Zoom sur quelques matériels à retrouver sur les voies et à proximité des 90 stands d’exposition les 20, 21 et 22 septembre à Montceau-les-Mines !</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>4NRJ&nbsp;</strong>mettra en avant CLINALERT, une solution autonome pour surveiller en continu les inclinaisons d\'un poteau lorsqu\'il y a un doute quant à sa stabilité.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>ACX&nbsp;</strong>exposera ses nouveautés 2023 : un plateau porte poteaux caténaires adaptable sur un châssis de remorque et une nouvelle pince poteau, la plus légère et la plus compacte du marché.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>LES ATELIERS DE JOIGNY&nbsp;</strong>et&nbsp;<strong>VTG</strong>&nbsp;présenteront de façon commune une sélection de wagons modifiés spécifiquement pour les besoins des travaux ferroviaires dont le wagon Rens VTG avec sa modification majeure : l\'ajout d\'un plancher en acier.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>BORFLEX</strong>&nbsp;exposera son système de traversée de voies SWISSCROSS.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>CEMBRE</strong>&nbsp;disposera de divers matériels : tronçonneuse portative, perceuse de rails…&nbsp;<strong>CHRONO FLEX</strong>&nbsp;présentera la Clinique du flex, une cabine de chantier en location, entièrement équipée et personnalisable pour confectionner des flexibles hydrauliques en totale autonomie.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>CML INDUSTRIES</strong>&nbsp;alignera trois wagons porte-rails.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>D2R</strong>&nbsp;exposera deux pelles à chenille rail-route.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>DIPOSTEL</strong>&nbsp;disposera de plusieurs matériels de mesure dont un chariot de mesure de géométrie des voies.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>ENCO</strong>&nbsp;exposera de nombreux engins dont la pelle rail-route sur chenilles ZX135 avec remorque D2R, la nacelle rail-route chenilles Sky C14 Neotec, la pelle rail-route sur pneus 216M Mecalac…&nbsp;<strong>ERMEWA SA</strong>&nbsp;exposera la version modernisée de son wagon ballastière disponible en location.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>GEISMAR</strong>&nbsp;révélera 5 nouveaux produits dont 3 avant-premières mondiales. Parmi eux, la nouvelle pelle rail-route KGT 140, ainsi que l’OPTIMA 300, un véhicule automoteur de maintenance caténaire.Et aussi...</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/framafer-presente-pour-la-premiere-fois-en-france-une-bourreuse-plasser-nouvelle-generation/\" target=\"_blank\">FRAMAFER&nbsp;</a>présentera pour la première fois en France une bourreuse PLASSER nouvelle génération.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/kooi-security-france-assure-le-videogardiennage-de-mecateameetings/\" target=\"_blank\">KOOI SECURITY FRANCE</a>&nbsp;fera la démonstration de son service innovant de vidéosurveillance clé en main.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-2023-quatre-pelles-rail-route-mecalac-a-decouvrir/\" target=\"_blank\">MECALAC</a>&nbsp;exposera quatre modèles de pelles rail-route.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-prolutech-eclaire-les-voies-avec-des-ballons-airstar/\" target=\"_blank\">PROLUTECH&nbsp;</a>mettra en lumière les voies d’exposition grâce à plusieurs ballons éclairants dernière génération AIRSTAR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-symbiose-gere-leau-courante-pour-la-restauration-des-participants/\" target=\"_blank\">SYMBIOSE TECHNOLOGIES</a>&nbsp;présentera sa citerne d’eau courante pour des installations temporaires sur chantier.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-wascosa-expose-un-wagon-ballastiere-radiocommande-et-automatise/\" target=\"_blank\">WASCOSA</a>&nbsp;exposera un wagon ballastière radiocommandé et automatisé.</p>\n<!-- /wp:paragraph -->','QUELS ENGINS ET OUTILS DÉCOUVRIR À MECATEAMEETINGS 2023 ?','','publish','open','open','','quels-engins-et-outils-decouvrir-a-mecateameetings-2023','','','2023-09-04 11:06:31','2023-09-04 11:06:31','',0,'http://test-wordpress-next.local/?p=33',0,'post','',0);
INSERT INTO `wp_posts` VALUES (34,1,'2023-09-04 11:02:16','2023-09-04 11:02:16','','logo','','inherit','open','closed','','logo','','','2023-09-04 11:02:16','2023-09-04 11:02:16','',33,'http://test-wordpress-next.local/wp-content/uploads/2023/09/logo.webp',0,'attachment','image/webp',0);
INSERT INTO `wp_posts` VALUES (35,1,'2023-09-04 11:05:15','2023-09-04 11:05:15','<!-- wp:image {\"id\":34,\"width\":420,\"height\":366,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://test-wordpress-next.local/wp-content/uploads/2023/09/logo.webp\" alt=\"\" class=\"wp-image-34\" style=\"width:420px;height:366px\" width=\"420\" height=\"366\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>Constructeurs d’engins, équipementiers, mainteneurs, fournisseurs et sous-traitants de la filière ferroviaire... Tous seront au rendez-vous de Mecateameetings 2023 pour présenter leurs nouveautés et leurs savoir-faire. Le plus ? Mecateameetings est le seul événement français permettant l’exposition et la démonstration concrète des engins et outillages. Zoom sur quelques matériels à retrouver sur les voies et à proximité des 90 stands d’exposition les 20, 21 et 22 septembre à Montceau-les-Mines !</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>4NRJ </strong>mettra en avant CLINALERT, une solution autonome pour surveiller en continu les inclinaisons d\'un poteau lorsqu\'il y a un doute quant à sa stabilité.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>ACX </strong>exposera ses nouveautés 2023 : un plateau porte poteaux caténaires adaptable sur un châssis de remorque et une nouvelle pince poteau, la plus légère et la plus compacte du marché.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>LES ATELIERS DE JOIGNY </strong>et <strong>VTG</strong> présenteront de façon commune une sélection de wagons modifiés spécifiquement pour les besoins des travaux ferroviaires dont le wagon Rens VTG avec sa modification majeure : l\'ajout d\'un plancher en acier.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>BORFLEX</strong> exposera son système de traversée de voies SWISSCROSS.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>CEMBRE</strong> disposera de divers matériels : tronçonneuse portative, perceuse de rails… <strong>CHRONO FLEX</strong> présentera la Clinique du flex, une cabine de chantier en location, entièrement équipée et personnalisable pour confectionner des flexibles hydrauliques en totale autonomie.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>CML INDUSTRIES</strong> alignera trois wagons porte-rails.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>D2R</strong> exposera deux pelles à chenille rail-route.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>DIPOSTEL</strong> disposera de plusieurs matériels de mesure dont un chariot de mesure de géométrie des voies.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>ENCO</strong> exposera de nombreux engins dont la pelle rail-route sur chenilles ZX135 avec remorque D2R, la nacelle rail-route chenilles Sky C14 Neotec, la pelle rail-route sur pneus 216M Mecalac… <strong>ERMEWA SA</strong> exposera la version modernisée de son wagon ballastière disponible en location.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>GEISMAR</strong> révélera 5 nouveaux produits dont 3 avant-premières mondiales. Parmi eux, la nouvelle pelle rail-route KGT 140, ainsi que l’OPTIMA 300, un véhicule automoteur de maintenance caténaire.Et aussi...</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/framafer-presente-pour-la-premiere-fois-en-france-une-bourreuse-plasser-nouvelle-generation/\" target=\"_blank\">FRAMAFER </a>présentera pour la première fois en France une bourreuse PLASSER nouvelle génération.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/kooi-security-france-assure-le-videogardiennage-de-mecateameetings/\" target=\"_blank\">KOOI SECURITY FRANCE</a> fera la démonstration de son service innovant de vidéosurveillance clé en main.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-2023-quatre-pelles-rail-route-mecalac-a-decouvrir/\" target=\"_blank\">MECALAC</a> exposera quatre modèles de pelles rail-route.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-prolutech-eclaire-les-voies-avec-des-ballons-airstar/\" target=\"_blank\">PROLUTECH </a>mettra en lumière les voies d’exposition grâce à plusieurs ballons éclairants dernière génération AIRSTAR.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-symbiose-gere-leau-courante-pour-la-restauration-des-participants/\" target=\"_blank\">SYMBIOSE TECHNOLOGIES</a> présentera sa citerne d’eau courante pour des installations temporaires sur chantier.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a rel=\"noreferrer noopener\" href=\"https://mecateamcluster.org/mecateameetings-wascosa-expose-un-wagon-ballastiere-radiocommande-et-automatise/\" target=\"_blank\">WASCOSA</a> exposera un wagon ballastière radiocommandé et automatisé.</p>\n<!-- /wp:paragraph -->','QUELS ENGINS ET OUTILS DÉCOUVRIR À MECATEAMEETINGS 2023 ?','','inherit','closed','closed','','33-revision-v1','','','2023-09-04 11:05:15','2023-09-04 11:05:15','',33,'http://test-wordpress-next.local/?p=35',0,'revision','',0);
